#' Striped dolphin ETP survey data
#' 
#' A data set containing short beaked dolphin sightings, transects data
#' and a mesh modeling the survey area. The data is generated by 
#' \code{\link{io_strdolphin.pkgdata.save}}, which loads the raw data
#' using \code{\link{io_strdolphin.pkgdata.load}}. The components of the data
#' set are accessible via \code{\link{io_whales.sightings}}, 
#' \code{\link{io_strdolphin.transects}} and \code{\link{io_strdolphin.mesh}}.
