#' \code{\link{io_strdolphin.boundary}} as well as 
#' \code{\link{io_strdolphin.pkgdata.coast}}
#' 
#' @source \url{http://www.creem.st-andrews.ac.uk:8082/ESSMod/case-studies}
#' @examples \\donttest{ data(strdolphin) ; plot(strdolphin)}
